OriginalAxioms:
:UsingSomething rdfs:comment UsingSomething is the most general sense of the verb use;
          the thing used can be abstract or physical; it can be knowledge,
          an ability, or a PhysicalObject, among other things.  For the subtype of
          using a PhysicalObject, use UsingAnInstrument.

           Corresponds to verb sense 1 of use in WordNet:
             1. 1387 use, utilize, utilise, apply, employ - put into service;
                make work or employ something for a particular purpose 
                or for its inherent or natural purpose; use your head!;
                we only use Spanish at home; I cant use this tool; 
                Apply a magnetic field here; This thinking was applied 
                to many projects; How do you utilize this tool?; 
                I apply this rule to get good results; use the plastic bags 
                to store the food; He doesnt know how to use a computer

